import Navbar from './Navbar';
import Form from './Form';
import Button from '@material-ui/core/Button';
import ExerciseDisplay from './ExerciseDisplay'
import {useState} from 'react'
import blob from './blob.svg'
import blob2 from './blob2.svg'


function App() {

  const [time, setTime] = useState(5)
  const [focus, setFocus] = useState("fullBody")
  //fullBody, cardio, legs, abs
  const [level, setLevel] = useState(2)

  //called by button in form, set's time based on slider value
  const handleSubmit = (time) => {
    setTime(time)
    console.log("time changed to " + time)
  } 

  //called by form, sets level when level button is clicked
  const handleLevel = (level)=> {
    setLevel(level)
    console.log("level set to " + level)
  }

  //called by form, sets focus when level button is clicked
  const handleFocus = (focus)=> {
    setFocus(focus)
    console.log("focus set to " + focus)
  }


  return (
    <div className="App">
      <div className="Component">
        <Navbar></Navbar>
        <Form handleSubmit={handleSubmit} handleFocus={handleFocus} handleLevel={handleLevel} level={level} focus={focus}/>
        <ExerciseDisplay time={time} focus={focus} level={level}></ExerciseDisplay>
        <img className="blob" src={blob}></img>
        <img className="blob2" src={blob2}></img>
      </div>
    </div>
  );
}

export default App;
